export const standardizeWorkout = workout => {
  if (!workout.id || !workout.name) {
    console.error('Invalid workout object:', workout);
    return null;
  }

  return {
    id: workout.id,
    name: workout.name,
    programId: workout.programId || '',
    exercises: workout.exercises || [],
    order: workout.order || 1
  };
};
